import React, {Component} from 'react';
import './../../css/RA-1.css';

export default class TeamList extends Component {

    constructor(props) {
        super();
        this.state = {
            teamName : "",
            teamMembers : {}
        }
    }

    componentDidMount() {
        console.log(this.props.teamName);
        if(this.props.teamName == "RA") {
            this.state.teamMembers = this.raTeamMembers;
        }
    }

    raTeamMembers = {

        team : "Resident Assistants",
        harrison : {
            id : 1,
            name : "Harrison Newman",
            img : "/images/harrison-newman-profile-pic.jpg",

        },
        david : {
            id : 2,
            name : "David Walker",
            img : "/images/david-walker-profile-pic.jpg",
        },
        emily : {
            id : 3,
            name : "Emily Clubb",
            img : "images/emily-profile.jpeg",
        }
    }

    render() {

        return(
            <div>
                <h1 id="text-danger">h {this.state.teamMembers.team}</h1>
                {/* {
                    this.state.teamMembers.map( member =>
                        <div className="">
                            <h1>Harrison Newman</h1>
                            <img src="/images/harrison-newman-profile-pic.jpg" alt="harrison-newman-profile-pic" id="harrison" />
                            <a className="link-text"  href="/harrison_newman"><h3>Meet Harrison</h3></a>
		                </div>

                    )
                } */}

        		<div className="container-fluid row">
            		<div className="profile col-3 col-md-4 col-sm-6 col-xs-8">
                		<h1>Harrison Newman</h1>
		                <img src="/images/harrison-newman-profile-pic.jpg" alt="harrison-newman-profile-pic" id="harrison" />
		                <a className="link-text"  href="/harrison_newman"><h3>Meet Harrison</h3></a>
		            </div>
		            <div className="profile col-3 col-md-4 col-sm-6 col-xs-8">
		                <h1>David Walker</h1>
		                <img src="/images/david-walker-profile-pic.jpg" alt="david-walker-profile-pic" />
		                <a className="link-text"  href="/david_walker"><h3>Meet David</h3></a>
		            </div>
		            <div className=" profile col-3 col-md-4 col-sm-6 col-xs-8">
		                <h1>Emily Clubb</h1>
		                <img className="long-photo" src="/images/emily-profile.jpeg" alt="emily-clubb-profile"/>
		                <a  href="/emily_clubb"><h3>Meet Emily</h3></a>
		            </div>
		        </div>

            </div>
        ); 
    }
}
